import React from 'react';
import { Link } from 'react-router-dom';


const NavigationBar = (props) => {




    console.log(props);

    return (
        <div>


                {props.navinfo.catTitle ?
                <Link to={`/cateogry/${props.navInfo.catId}`}>
                    `${props.navInfo.catTitle} / `
                    </Link>

                : null}


                {props.navinfo.subCatTitle ?
                 <Link to={`/cateogry/${props.navInfo.catId}`}>
                    `${props.navInfo.subCatTitle} / `
                    </Link>
                : null} 


            {props.title ? 
                props.title
            : null}

        </div>
    );
};

export default NavigationBar;
